import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div class="main-menu">
        <div id="darken-bg"></div>
        <h1>LearnTheBasics.it</h1>
        <div class="button-container">
          <button>Continue</button>
          <button>New Game</button>
          <button>Options</button>
          <button>Quit Game</button>
        </div>
      </div>
    </div>
  );
}

export default App;
